def main():
    import sys
    input = sys.stdin.read().split('\n')
    idx = 0

    n = int(input[idx])
    idx += 1

    operations = []
    while idx < len(input) and len(operations) < n:
        operations.append(input[idx].strip())
        idx += 1

    q = int(input[idx])
    idx += 1

    queries = []
    for _ in range(q):
        queries.append(input[idx].strip())
        idx += 1

    inventory = {}

    for op in operations:
        if idx >= len(input):
            break
        line = input[idx].strip()
        if not line:
            idx += 1
            continue
        parts = line.split()
        if not parts:
            idx += 1
            continue
        op_type = parts[0]
        id = parts[1]
        qty = int(parts[2])
        if op_type == '+':
            if id in inventory:
                inventory[id] += qty
            else:
                inventory[id] = qty
        else:
            if id in inventory:
                inventory[id] -= qty

    for query in queries:
        if query in inventory:
            if inventory[query] > 0:
                print("in stock")
            else:
                print("out of stock")
        else:
            print("out of stock")

if __name__ == "__main__":
    main()
